import Footer from '../../../containers/Footer/Footer';
import DetailsJson from "../../../Json/WehicleDetails/Car1.json"

// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";
// Import Swiper styles
import "swiper/css";
import "swiper/css/lazy";
import "swiper/css/pagination";
import "swiper/css/navigation";


// import required modules
import { Lazy, Pagination, Navigation } from "swiper";
function WehicleDetails() {
  return (
    <div>
        <Navbar/>
        <TextBanner title="MERCEDES VÄ°TO"/>
        <Swiper
        style={{
          "--swiper-navigation-color": "#fff",
          "--swiper-pagination-color": "#fff",
        }}
        lazy={true}
        pagination={{
          clickable: true,
        }}
        navigation={true}
        modules={[Lazy, Pagination, Navigation]}
        className="mySwiper"
      >
        <SwiperSlide>
          {DetailsJson.map((details) => {
           details.imgs.map((test) => {
            console.log(test);
            <Fragment>
                    <img className="swiper-lazy"data-src={test.img} />
                    <div className="swiper-lazy-preloader swiper-lazy-preloader-white"></div>
                </Fragment>
           })
        })}
        </SwiperSlide>
      </Swiper>
    <Footer/>
    </div>
  )
}

export default WehicleDetails
